css:
.title-bar {
  padding: 15px;
  letter-spacing: 0.08em;
  font-size: 1.1em;
}
.tree-view .list-item {
  font-size: 1.35em;
}
.file.entry.list-item.selected span {
  font-weight: bold;
  font-size: 1.15em;
  margin: 4px 0;
}
.file.entry.list-item.selected span:after {
  content: ' (you are here)';
}
.tab-bar .tab.active {
  min-width: 320px;
}
.tab.sortable.active {
  font-size: 1.3em;
  color: #00ff00;
}
.cursor-line.cursor-line-no-selection {
  background-color: #000;
  color: #00ff00;
}
atom-text-editor .line.cursor-line {
  background-color: #000;
}
.atom-text-editor::shadow .vertical-scrollbar {
  cursor: pointer;
}
.file-info .current-path {
  color: #00ff00;
  font-size: 1.6em;
}
.rdio-container .rdio-sound-bar {
  background: #00ff00;
}
.rdio-container a {
  color: #00ff00;
  opacity: 0.5;
}
.atom-pane-axis.horizontal {
  padding-bottom: 8px;
  background: #000;
}
.atom-pane.active {
  border-bottom: 1px solid #00ff00;
}
.atom-pane-container .atom-pane-axis.vertical > *:last-child {
  max-height: 400px;
}
.tree-view {
  font-size: 0.85em;
}
.fuzzy-finder {
  font-size: 1.4em;
}
.list-tree li.list-nested-item .list-item {
  line-height: 1.6rem;
}
